import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./style.css";
import MainHeader from "../Home/MainHeader";
import jobpic from '../../images/jobbank.jpg'
import img1 from '../../images/engineer.png'
import operator from '../../images/operator.png'
import manager from '../../images/manager.png'
export default class JobBank extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="">
{/* POPULAR JOBS START =============>>>>>>>>*/}
<div>
<h3 className='mt-4 font-weight-bold'>Popular Categories</h3>
<div className='container-fluid'>
<div className='row mt-4 justify-content-center' >

<div className='col-md-2 shadow divStl m-3' style={{backgroundColor:'#f5f6f7'}}>

                    <p style={{ fontSize: "3.5em" }}>
                    <img src={manager} width='80px' height='80px'/>
                    </p>
                    <p style={{ fontSize: "1.5em" }}>Supervisor</p>
                  </div>
                
                  <div className='col-md-2 shadow m-3' style={{backgroundColor:'#f5f6f7'}}>

                    <p style={{ fontSize: "3.5em" }}>
                      {/* <i class="fas fa-laptop-code"></i>operator */}
                      <img src={operator} width='80px' height='80px'/>
                    </p>
                    <p style={{ fontSize: "1.5em" }}>Operator</p>
                  </div>
                  <div className='col-md-2 shadow m-3' style={{backgroundColor:'#f5f6f7'}}>

                    <p style={{ fontSize: "3.5em" }}>
                      <i class="fas fa-laptop-code"></i>
                    </p>
                    <p style={{ fontSize: "1.5em" }}>Saylani Mass IT</p>
                  </div>
                  <div className='col-md-2 shadow m-3' style={{backgroundColor:'#f5f6f7'}}>

<p style={{ fontSize: "3.5em" }}>
  {/* <i class="fas fa-laptop-code"></i> */}
  <img src={img1} width='80px' height='80px'/>
</p>
<p style={{ fontSize: "1.5em" }}>Labour</p>
</div>
                  </div>
</div>
</div>

</div>
    );
  }
}
